{"h1": "Sie leiden unter l\u00e4stigen Hautbeschwerden? Dann qu\u00e4len Sie sich nicht l\u00e4nger und gehen Sie zum Hautarzt!", "description": null, "summary_text": "\nSie haben seit l\ufffdngerem Beschwerden mit Ihrer Haut und haben keine Lust mehr auf nervige Ausschl\ufffdge, l\ufffdstiges Jucken und unsch\ufffdne Verf\ufffdrbungen? Dann handeln Sie jetzt und gef\ufffdhrden Sie Ihre Gesundheit nicht weiter. Auch f\ufffdr eine pr\ufffdventive Vorsorgeuntersuchung sollten Sie regelm\ufffd\ufffdig Ihren Hautarzt aufsuchen. So k\ufffdnnen Sie sicher sein, nicht eines Tages von Hautkrebs oder \ufffdhnlichen gef\ufffdhrlichen Krankheiten \ufffdberrascht zu werden. Die Haut als gr\ufffd\ufffdtes und schwerstes Organ des menschlichen K\ufffdrpers istbesonders empfindlich und vielen Belastungen ausgesetzt. Daher bedarf es einer besonders sorgf\ufffdltigen und professionellen Pflege, damit es zu keinen Unregelm\ufffd\ufffdigkeiten oder Krankheiten kommt. Ihr Hautarzt ist Ihr Experte bei allen Fragen und Sorgen rund um Ihre Haut. Gef\ufffdhrden Sie Ihre Gesundheit nicht l\ufffdnger und informieren Sie sich bei dem Hautarzt Ihres Vertrauens \ufffdber die Risiken und Gefahren, die eine kranke Haut mit sich bringt. So k\ufffdnnen Sie schnell und professionell vorbeugen!\n\ufffd Claudia Hautumm / pixelio.de\nEin Allergietest geh\ufffdrt zum Alltag von jedem Hautarzt.\n", "title": "Hautarzt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/hautarzt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.