{"h1": "Der Orthop\u00e4de, der Facharzt f\u00fcr den Bewegungsapparat", "description": null, "summary_text": "\nDer Orthop\ufffdde, der Facharzt f\ufffdr den Bewegungsapparat\nDer Orthop\ufffdde ist auch Facharzt f\ufffdr Unfallchirurgie\n\nWenn Muskeln und Gelenke schmerzen oder Sehen und B\ufffdnder Schwierigkeiten machen, dann ist der Orthop\ufffdde als Facharzt der richtige Ansprechpartner. Als Facharzt f\ufffdr den gesamten St\ufffdtz- und Bewegungsapparat geht ein Fachmann f\ufffdr Orthop\ufffddie den Beschwerden mit den verschiedensten diagnostischen Mitteln auf den Grund. Ihm stehen in erster Linie Laboruntersuchungen, R\ufffdntgen, Ultraschall, Computertomografie und Magnetresonanztomografie zur Verf\ufffdgung, um sich ein Bild von der Erkrankung zu machen. Auch das Gespr\ufffdch mit dem Patienten sowie die manuelle Untersuchung bilden eine wichtige S\ufffdule der Diagnostik. Die Behandlung erfolgt abgestimmt auf das Beschwerdebild des Patienten. Als typische Behandlungsmethoden wendet ein Orthop\ufffdde medikament\ufffdse, physikalische und chirurgische Therapien an. Mit einer speziellen Zulassung arbeiten Fach\ufffdrzte f\ufffdr Orthop\ufffddie und Unfallchirurgie auch als sogenannte Durchgangs\ufffdrzte. Niedergelassene Mediziner mit dieser Zusatzqualifikation \ufffdbernehmen die Behandlung von Arbeits- und Wegeunf\ufffdllen im Auftrag der Berufsgenossenschaft.Um seinen Patienten eine optimale Versorgung zukommen zu lassen,arbeitet der Orthop\ufffdde mit anderen Berufsgruppen im Fachgebiet Orthop\ufffddie zusammen. So unterst\ufffdtzen Physiotherapeuten und Krankengymnasten die Behandlung. Orthop\ufffddietechniker \ufffdbernehmen die ma\ufffdgenaue Anfertigung von Prothesen sowie Orthesen. Einlagen und speziell auf das individuelle Beschwerdebild zugerichtetes Schuhwerk sind dagegen das Metier des Orthop\ufffddieschuhtechnikers. Ein besonderes Arbeitsfeld ist die Kinderorthop\ufffddie. Bedingt durch das Wachstum kann der Orthop\ufffdde viele St\ufffdrungen in ambulanter oder station\ufffdrer Therapie richten und St\ufffdrungen im Erwachsenenalter oder operative Eingriffe vermeiden. Die konservative Therapie steht in allen Altersklassen im Vordergrund.Eine Sonderstellung in der Orthop\ufffddie haben die Kieferorthop\ufffdden. Diese Zahn\ufffdrzte mit fach\ufffdrztlicher Zusatzausbildung sind Spezialisten auf dem Gebiet der Behandlung von Fehlstellungen des Gebisses. Sie sind Ansprechpartner erster Wahl bei Fehlformungen des Kauapparates vom S\ufffduglings- bis in das Erwachsenenalter. Von der Lippen-Kiefer-Gaumenspalte bis zur Korrektur von Fehlstellungen bei Erwachsenen reicht das Leistungsspektrum.\n\ufffd Dan Race - Fotolia.com\nDer Orthop\ufffdde: Facharzt f\ufffdr Knochen, Gelenke und Muskeln\n\n\n\nAusgew\u00e4hltes Bundesland: \n\n\nOrthop\ufffdde in Deutschland:\n\n\n", "title": "Orthop\u00e4de im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/orthopaede", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "http://www.gelbeseiten.de", "text": "Gelbe Sei