{"h1": "Der Augenarzt Ihr Spezialist rund um die Augen", "description": null, "summary_text": "\nDie Augenheilkunde, Fachbegriff Ophthalmologie, besch\ufffdftigt sich mit Erkrankungen und St\ufffdrungen des Auges und auch des Sehsinnes. Augenarzt ist einer der \ufffdltesten medizinischen Berufe. Schon vor \ufffdber 3600 Jahren wurden Augenoperationen schriftlich dokumentiert. Bis zum Ende des 18.Jahrhunderts wusste man nicht viel \ufffdber die Funktionsweise des Auges und Behandlungen endeten oft mit Blindheit f\ufffdr den Patienten. Heute ist der Augenarzt kompetenter Ansprechpartner f\ufffdr alleThemen rund um das Auge und den Sehsinn. Dies beinhaltet nicht nur Fehlsichtigkeit, sondern auch Erkrankungen der Netzhaut oder der Hornhaut und vieles mehr. Auch die Zusammenarbeit mit anderen Teilgebieten der Medizin, wie der Hals-Nasen-Ohrenheilkunde oder der Neurologie ist f\ufffdr die Diagnose oft wichtig. Vorbeugend bietet eine Augenarztpraxis Ihnen auch viele Vorsorgeuntersuchungen, wie zum Beispiel die Glaukomvorsorge gegen den gr\ufffdnen Star, an.\n\ufffd Petra Bork / pixelio.de\nDer Augenarzt sagt Ihnen, ob Sie eine Brille ben\ufffdtigen.\n", "title": "Augenarzt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/augenarzt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http:/