{"h1": "B\u00f6rse bei Gelbe Seiten", "description": null, "summary_text": "\nB\ufffdrse bei Gelbe Seiten\nWahl des Bundeslandes f\ufffdr passende Firmenadressen zu B\ufffdrse\n\n    \t\tSie haben im Branchenbuch von Gelbe Seiten B\ufffdrse in Anlage und Finanzierung gew\ufffdhlt. Um einen Ansprechpartner rund um Anlageverm\ufffdgen und Finanzierungsberatung zu finden, w\ufffdhlen Sie bitte zun\ufffdchst ein Bundesland aus. Firmenadressen rund um Treuhand- und Verm\ufffdgensverwaltung, Schuldnerberatung, Finanzierungspl\ufffdne und Anlagen werden Ihnen in der Stadt angezeigt, in der Sie einen Experten suchen m\ufffdchten. Die Finanz-Spezialisten beraten Sie umfassend zum Thema B\ufffdrse, stellen realistische Kalkulationen auf und planen Ihre Finanzsituation mit Ihnen durch. Fragen Sie Ihren Finanzberater - alle Kontaktdaten mit Telefonnummer und Adresse finden Sie im jeweiligen Eintrag.\n\n\n\nAusgew\u00e4hltes Bundesland: \n\n\n", "title": "B\u00f6rse im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/boerse", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/n