{"h1": "Zur Sicherheit regelm\u00e4\u00dfig zum Frauenarzt!", "description": null, "summary_text": "\nDer Frauenarzt wird auch Gyn\ufffdkologe genannt. Er behandelt Erkrankungen im Bereich des weiblichen Sexualtraktes. Im Unterschied zur Geburtshilfe geht es beim Frauenarzt darum, nicht-schwangere Frauen entsprechend zu untersuchen und zu therapieren. Die Ausbildung zum Gyn\ufffdkologen wird jedoch gemeinsam mit der Geburtshilfe durchgef\ufffdhrt. Eine wichtige Aufgabe des Frauenarztes besteht in den Vorsorgeuntersuchungen bzgl. einer m\ufffdglichen Erkrankung der weiblichen Brust. In der Krebsvorsorge spieltseine Arbeit eine wichtige Rolle. Um Gyn\ufffdkologe zu werden ben\ufffdtigt man nach einem abgeschlossenen Medizinstudium eine Weiterbildung, die f\ufffdnf Jahre dauert. Drei Jahre sind im Stationsdienst zu leisten. Weitere Zusatzqualifikationen sind beispielsweise die Pr\ufffdnatalmedizin oder die minimal-invasive Chirurgie. In der Deutschen Gesellschaft f\ufffdr Gyn\ufffdkologie und Geburtshilfe sind rund 5000 Frauen\ufffdrzte in Deutschland organisiert. Die Gesellschaft enth\ufffdlt 21 Arbeitsgemeinschaften, acht Regionalgesellschaften, sowie international aktive Gesellschaften.\n\ufffd JMG / pixelio.de\nEiner schwangeren Frau wird beim Frauenarzt der Bauchumfang vermessen.\n", "title": "Frauenarzt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/frauenarzt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_