{"h1": "Das Taxi bringt sie genau ans Ziel", "description": null, "summary_text": "\nWer kein Auto hat oder gerade nicht fahren kann, der hat meist die Wahl zwischen \ufffdffentlichen Verkehrsmitteln und einem Taxi. Anders als die \ufffdffentlichen Verkehrsmittel holt das Taxi Sie ab, wann Sie wollen und von wo Sie wollen, und bringt Sie dann genau an Ihr Ziel. Taxis sind rund um die Uhr im Einsatz und fahren Sie \ufffdberall hin. So k\ufffdnnen sie auch Retter in der Not sein, wenn Sie zum Beispieleine Panne haben oder dringend zum Arzt m\ufffdssen. Ein Taxi bietet Ihnen den Luxus, entspannt und bequem reisen zu k\ufffdnnen. Sie m\ufffdssen nicht auf den Verkehr achten oder sich, wenn Sie fremd sind, erst den richtigen Weg suchen. Sie k\ufffdnnen aus dem Fenster sehen und die Umgebung erkunden, lesen, telefonieren oder sich mit dem Fahrer unterhalten. Eine Taxifahrt ist, egal ob in der Fremde oder zu Hause, die bequemste Art zu reisen.\n\ufffd Andreas Morlok / pixelio.de\nJedes Taxi hat die Pflicht, ein Dachschild zu f\ufffdhren.\n", "title": "Taxi im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/taxi", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.