{"h1": "Der Lungenarzt - Ein Facharzt aus dem Bereich innere Medizin", "description": null, "summary_text": "\nDer Lungenarzt ist ein Facharzt auf dem Gebiet der Pneumologie, was sich aus dem griechischen ableitet und zu Deutsch \"Lungenheilkunde\" bedeutet. Nachdem er das sechsj\ufffdhrige Medizinstudium mit Staatsexamen absolviert hat, muss er sich weitere sieben Jahre, unter anderem in einer Lungenfachklinik, weiterbilden, um sich als ein Arzt auf diesem Fachgebiet bezeichnen zu d\ufffdrfen. Die Pneumologie ist ein Teilgebiet der inneren Medizin und befasst sich mit der Vorbeugung, der Erkennung undBehandlung von Atemwegserkrankungen. Zu den Atemwegen z\ufffdhlt die Lunge, die Bronchien, das Mittelfell und die Pleura. Typische Erkrankungen, bei denen Sie sich an einen dieser \ufffdrzte wenden k\ufffdnnen sind beispielsweise Asthma, Bronchitis, Lungenentz\ufffdndung oder bei einer Lungenembolie. Zu den h\ufffdufig verwendeten Untersuchungsmethoden geh\ufffdren unter anderem die Computertomografie, Blutgasanalysen oder Lungenfunktionstests. Wenn Sie keinen Lungenarzt bei sich in der N\ufffdhe kennen, kann Ihnen in der Regel auch Ihr Hausarzt einen nennen.\n\ufffd Rainer Sturm / pixelio.de\nDer Lungenfunktionstest geh\ufffdrt zu den Standarduntersuchungen beim Lungenarzt.\n", "title": "Lungenarzt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/lungenarzt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_l