{"h1": "Ein Neurologe ist den Nerven auf der Spur", "description": null, "summary_text": "\nEin Neurologe befasst sich in seinem Fachgebiet mit den Erkrankungen des Nervensystems und ist in Deutschland als ein Teilgebiet der Inneren Medizin entstanden. In der Neurologie befasst der Mediziner sich haupts\ufffdchlich mit dem Gehirn und dem R\ufffdckenmark, das als zentrales Nervensystem zusammengefasst wird. Aber auch das periphere Nervensystem, das alle Nerven au\ufffderhalb des zentralen Nervensystems zusammenfasst, f\ufffdllt in das Untersuchungsgebiet einesNeurologen. Eine Grundlage f\ufffdr eine korrekte neurologische Untersuchung ist vor allem die Befragung des Patienten nach seinen Beschwerden, die sogenannte Anamnese. Die Untersuchung, die ein Neurologe durchf\ufffdhrt, ist zun\ufffdchst dazu da, einige Erkrankungen auszuschlie\ufffden, indem vor allem Reflexe, Sensibilit\ufffdt und Motorik \ufffdberpr\ufffdft werden. Erst in darauffolgenden Schritten nutzt ein Neurologe weitere Untersuchungsmethoden, wie etwa Ultraschall, eine Computertomografie oder eine Magnetresonanztomografie.\n\ufffd Gerd Altmann / pixelio.de\nAls Neurologe behandelt man Erkrankungen des Nervensystems.\n", "title": "Neurologe im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/neurologe", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur St