{"h1": "Das Kino - damals und heute", "description": null, "summary_text": "\nSie erinnern sich sicher nicht daran, aber die erste \ufffdffentliche Filmauff\ufffdhrung fand zum Ende des 19. Jahrhunderts in Manhattan statt. Im Laufe der Jahre verbreiteten sich die Kinos weltweit, zun\ufffdchst in den gr\ufffd\ufffderen St\ufffddten. Bei den ersten Kinofilmen handelte es sich um Stummfilme, nach einigen Jahren gab es die ersten Kinos, die auch vertonte Filme auff\ufffdhrten. Schon damals war das Kino eine beliebte Freizeitbesch\ufffdftigung. Dieim Kino aufgef\ufffdhrten Filme haben sich auch st\ufffdndig weiterentwickelt. Die schwarz-wei\ufffd Filme aus den Anf\ufffdngen der Filmgeschichte sind kaum zu vergleichen mit den heutigen Filmen, die zum Teil schon dreidimensional ausgestrahlt werden. Nat\ufffdrlich sind die Produktionskosten f\ufffdr die Filme um ein Vielfaches gestiegen und liegen mittlerweile schon im mehrstelligen Millionenbereich. Haben Sie auch Lust bekommen, mal wieder einen sch\ufffdnen Abend im Kino zu verbringen?\n\ufffd Erich Kasten / pixelio.de\nKino ? hier die T\ufffdr des nostalgischen Studiokinos in Magdeburg.\n", "title": "Kino im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/kino", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.