{"h1": "Hilfe bei jedem gesundheitlichen Problem bietet der Allgemeinarzt", "description": null, "summary_text": "\nDer Allgemeinarzt hilft Ihnen in allen Lebenslagen. Ob Sie sich abgeschlagen f\ufffdhlen, eine Erk\ufffdltung im Anmarsch ist oder das Bein schmerzt: Ihr Hausarzt pr\ufffdft Ihren Gesundheitszustand ausf\ufffdhrlich, ber\ufffdt Sie und erstellt im Zweifel eine \ufffdberweisung zum Facharzt. Mit Ihrem Hausarzt besprechen Sie Ihre Symptome, so dass er eine umfassende Diagnose stellen kann. H\ufffdufig sind psychische Ursachen, die in physische Schmerzen m\ufffdnden. Umso wichtiger ist es, wenn man dem Gegen\ufffdber Vertrauen entgegen bringen kann.Gerade f\ufffdr \ufffdltere Menschen ist der Allgemeinarzt oft der einzige Gespr\ufffdchspartner am Tag. Der morgendliche Besuch der Hausarztpraxis ist deshalb Teil des Tagesablaufs. Aus diesem Grund spezialisieren sich immer mehr Allgemeinmediziner auf die \ufffdltere Bev\ufffdlkerung. Doch gerade dort, wo der Anteil der \ufffdlteren h\ufffdher ist (in den l\ufffdndlichen Regionen) fehlt der ein oder andere Allgemeinarzt.\n\ufffd Thomas Siepmann / pixelio.de\nDer Reflexhammer wird vom Allgemeinarzt h\ufffdufig genutzt.\n", "title": "Allgemeinarzt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/allgemeinarzt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur 