{"h1": "Das Berufsbild Zahnarzt im Wandel der Zeit", "description": null, "summary_text": "\nEtwa f\ufffdnf bis zehn Prozent der Deutschen leiden sch\ufffdtzungsweise unter einer so genannten Zahnbehandlungsphobie. Dabei sind heutzutage viele Zahn\ufffdrzte darauf spezialisiert, ihren Patienten die Angst zu nehmen, nicht zuletzt aufgrund umfassender Zusatzausbildungen und des Einsatzes modernster Technologien, die eine nahezu schmerzfreie Behandlung erm\ufffdglichen. Praktizierende Zahn\ufffdrzte gab es bereits im f\ufffdnften Jahrhundert vor Christus, die sogenannte moderne Zahnheilkunde wurde im Jahr 1728 begr\ufffdndet. Die modernen Zahnarztpraxen von heute haben allerdings mit den damaligen Methoden nichts mehr gemein.Der Zahnarzt verf\ufffdgt heute \ufffdber hervorragende M\ufffdglichkeiten, auch fortgeschrittene Erkrankungen der Z\ufffdhne der Z\ufffdhne effektiv zu behandeln und damit die Zahnerhaltung sicherzustellen. Die Laserbehandlung l\ufffdst das klassische Bohren ab und auch die Praxiseinrichtung beim Zahnarzt ist heute oft deutlich angenehmer gestaltet. Der Zahnarzt von heute ist l\ufffdngst nicht mehr nur zum Z\ufffdhne ziehen und L\ufffdcher f\ufffdllen da - er bildet sich weiter zum Kieferorthop\ufffdden oder Oralchirurg und findet zunehmend auch neue T\ufffdtigkeitsfelder im Bereich der \ufffdsthetischen Zahnmedizin.\n\ufffd Alexandra H. / pixelio.de\nDurch eine gute Zahnpflege wird der Besuch beim Zahnarzt angenehmer\n", "title": "Zahnarzt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/zahnarzt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://servic