{"h1": "Radiologie - ein wichtiges Teilgebiet der Medizin", "description": null, "summary_text": "\nDie Radiologie als bildgebendes Verfahren, hat einen sehr hohen Stellenwert in unserer medizinischen Diagnostik. Mit Hilfe von unterschiedlichsten Verfahren, wie beispielsweise der Magnetresonanztomographie erm\ufffdglicht die Radiologie den \ufffdrzten ohne gr\ufffd\ufffderen Aufwand Krankheiten zu identifizieren und zu lokalisieren ohne einen operativen Eingriff vorzunehmen. Die Vorbereitungen f\ufffdr eine solche Untersuchung sind unterschiedlich. Ein einfaches R\ufffdntgen, um zum Beispiel einen Knochenbruch aufzudecken geht meist sehr schnell und zum Schutz vor Strahlungwerden K\ufffdrperpartien, die nicht ger\ufffdntgt werden mit Kleidung aus Blei abgedeckt. Um auch Gewebe auf einem R\ufffdntgenbild sichtbar zu machen, muss etwas mehr Aufwand betrieben werden, da Gewebe nicht fest und dicht genug ist, um es bildlich festzuhalten. Hierzu verwendet man Kontrastmittel, die der Patient entweder schluckt oder die intraven\ufffds zugef\ufffdhrt werden. Die Radiologie ist ein f\ufffdr unsere Medizin nicht mehr weg zu denkendes, wichtiges, diagnostisches Verfahren.\n\ufffd Rainer Sturm / pixelio.de\nR\ufffdntenger\ufffdte finden ihren Einsatz in der Abteilung Radiologie.\n", "title": "Radiologie im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/radiologie", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout