{"h1": "Nicht nur zum Kopieren in den Copyshop", "description": null, "summary_text": "\nIhr Copyshop stellt Ihnen nicht nur Schwarzwei\ufffd- und Farbkopierer in Selbstbedienung zur Verf\ufffdgung, sondern bietet au\ufffderdem Bindung, Heftung und Laminierung an. Ebenso geh\ufffdren Schneidemaschinen f\ufffdr den exakten Zuschnitt ihrer Drucksorten zur Standardausr\ufffdstung. Auf den g\ufffdngigen Kopierger\ufffdten sind Kopien und Ausdrucke bis zum Format A3 m\ufffdglich. F\ufffdr gr\ufffd\ufffdere Formate findet man vielerorts im Copyshop Gro\ufffdformatkopierer oder Plotter. Das Leistungsspektrum erstreckt sich auch auf das Einscannen von Unterlagen mit anschlie\ufffdenderDaten\ufffdbergabe auf CD oder via E-Mail. Wenn Sie selbst keine Zeit oder Lust f\ufffdr die Endverarbeitung (Zuschneiden, Binden etc.) haben, hilft Ihnen das Servicepersonal des Copyshop gerne aus. Immer \ufffdfter k\ufffdnnen Auftr\ufffdge auch komplett per Datenversand \ufffdber das Internet abgewickelt und anschlie\ufffdend zugestellt werden. Viele Copyshops belohnen Kundentreue \ufffdber ein Bonussystem, bei dem die Kosten pro Seite enorm sinken, je mehr man kopiert. Nachfragen lohnt sich!\n\ufffd JMG / pixelio.de\nIm Copyshop k\ufffdnnen Sie auch auf buntem Papier drucken.\n", "title": "Copyshop im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/copyshop", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Auslogge