{"h1": "Mit einer Ferienwohnung k\u00f6nnen Sie sich \u00fcberall ein bisschen zu Hause f\u00fchlen.", "description": null, "summary_text": "\nBestimmt kennen Sie das: Die n\ufffdchsten Ferien stehen vor der T\ufffdr und Sie m\ufffdssen sich nicht nur f\ufffdr den Ferienort und das ganze Programm entscheiden, sondern haben auch die Qual der Wahl, was Ihre Unterkunft angeht. Eine Ferienwohnung bringt Ihnen viele Vorteile! Bleiben Sie unabh\ufffdngig von den Essenszeiten der Hotels, ziehen Sie sich mit Kindern und Tieren zur\ufffdck und logieren Sie kosteng\ufffdnstiger als in einem Hotel und das beiviel mehr Platz. Trotzdem genie\ufffden Sie einen Komfort, den Sie auf keinem Campingplatz finden werden. Entscheiden Sie, wann Sie essen und was Sie essen, schlie\ufffdlich wissen Sie am besten was Ihnen wirklich gut tut und f\ufffdhlen Sie sich auch im Urlaub ein wenig zu Hause. Und falls Sie sich am Ende Ihres Urlaubs um nichts k\ufffdmmern wollen kann bei den meisten Ferienwohnungen die Endreinigung kosteng\ufffdnstig in Auftrag gegeben werden.\n\ufffd ceeweemedia.de / pixelio.de\nEine Ferienwohnung ist in der Ferienzeit eine beliebte Unterkunft.\n", "title": "Ferienwohnung im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/ferienwohnung", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url"