{"h1": "Physiotherapie, um beweglich und gesund zu bleiben", "description": null, "summary_text": "\nFr\ufffdher war sie unter dem Namen Krankengymnastik bekannt: die Physiotherapie. Sie dient vor allem dazu, die Bewegungs- und Koordinationsf\ufffdhigkeit des K\ufffdrpers zu erhalten, zu verbessern oder wiederherzustellen. Die Behandlung wird immer von ausgebildeten Physiotherapeuten durchgef\ufffdhrt, allerdings muss die medizinische Notwendigkeit von einem Arzt erkannt und die entsprechenden Ma\ufffdnahmen verordnet werden. Neben typischen physiotherapeutischen \ufffdbungen, die den Muskelaufbau f\ufffdrdern und gegebenenfalls den Bewegungsradius verbessern sollen, k\ufffdnnen auch andereReize gebraucht werden, zum Beispiel Hitze, K\ufffdlte, Druck, Strahlung oder Elektrizit\ufffdt. Wo noch vor einigen Jahren das Hauptaugenmerk der Physiotherapie auf der reinen Wiederherstellung der Normalit\ufffdt laut medizinischer Definition lag, ist man mittlerweile eher dazu \ufffdbergegangen, den Menschen im Ganzen zu sehen und zu behandeln. Das bedeutet auch, dass es keinen medizinisch doktrinierten Normalzustand mehr gibt sondern der Patient vorgibt, was f\ufffdr seine Bewegungen bei einer Physiotherapie normal ist.\n\ufffd rudolf ortner / pixelio.de\nIst der Gips ab, geht's zur Physiotherapie\n", "title": "Physiotherapie im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/physiotherapie", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten