{"h1": "Was macht ein Reiseb\u00fcro?", "description": null, "summary_text": "\nEin Reiseb\ufffdro bietet sowohl Urlaubs- als auch Gesch\ufffdftsreisen an. Meist tritt das Reiseb\ufffdro dabei als Vermittler f\ufffdr die gro\ufffden Reiseveranstalter auf. Im Gegenzug erh\ufffdlt der Inhaber von den Veranstaltern eine Provision f\ufffdr jede vermittelte Reise, die in der Regel in der Branche zwischen vier und 13 Prozent des Reisepreises liegt. W\ufffdhrend jeder ohne weitere Qualifikation nach Anmeldung eines Gewerbes als Reisevermittler t\ufffdtig sein kann, sind die Anforderungen h\ufffdher, wenn das Reiseb\ufffdro zugleich auch als Reiseveranstalter auftreten m\ufffdchte. Unter anderem wird vom Inhaber dann der Nachweis einer Insolvenzversicherung verlangt.Obwohl die Konkurrenz durch das Internet mittlerweile sehr gro\ufffd ist, sch\ufffdtzen viele Kunden den pers\ufffdnlichen Service in einem Reiseb\ufffdro Ihrer Stadt. Die Basisinformationen \ufffdber die Urlaubsdestination, die Hotels vor Ort und die Sehensw\ufffdrdigkeiten kann jeder Reisende selbst im Netz oder im Katalog nachlesen. Was eineReiseberatung aber erst wirklich wertvoll macht, sind die Tipps, die nicht im Reisef\ufffdhrer stehen, und Erfahrungsberichte eigener Reisen. Und genau das ist das gro\ufffde Plus der Reiseprofis im Reiseb\ufffdro: Sie kennen die Ziele aus ihren Angeboten sehr genau und k\ufffdnnen wertvolle Hinweise geben, damit der Urlaub dann auch wirklich ein Traumurlaub wird.Deshalb setzt sich vor allem in den gro\ufffden St\ufffddten der Trend durch, dass sich das Reiseb\ufffdro auf bestimmte Angebote oder Ziele spezialisiert. Das Reiseb\ufffdro, das alles vom pauschalen All Inclusive Urlaub bis hin zum Abenteuerurlaub anbietet, d\ufffdrfte auf Dauer der Vergangenheit angeh\ufffdren. Nur durch Spezialisierung und pers\ufffdnliche Fachkompetenz k\ufffdnnen sich Reiseb\ufffdros vor Ort gegen die Mitbewerber aus dem Netz dauerhaft behaupten. F\ufffdr Kunden bedeutet das: Die zeitraubende Suche auf mehreren Websites entf\ufffdllt - und durch pers\ufffdnliche Beratung wurde schon so mancher Urlaub noch ein St\ufffdck sch\ufffdner.\n\ufffd Schulz-Design - Fotolia.com\nDas Reiseb\ufffdro: Wer in den Urlaub fahren will, ist hier gut beraten\n", "title": "Reiseb\u00fcro im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/reisebuero", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "http://www.gelbeseiten.de", "text": "Gelbe Seiten", "tag": "a"}, {"url": "http://www.gelbeseiten.de", "text": "\n\t\t\t\t\t\t", "tag": "a"}, {"url": "http://www.gelbeseiten.de/branchenbuch/freizeit---und---reisen", "tag": "a"}, {"url": "javascript:history.back();", "text": "zur\u00fcck", "tag": "a"}, {"url": "http://de.fotolia.com/id/42355961", "text": "\u00a9 Schulz-Design - Fotolia.com", "tag": "a"}, {"url": "http://www.gelbeseiten.de/reisebuero/berlin", "text": "\n\t\t\t\t\t\t\t\t", "tag": "a"}, {"url": "http://www.gelbeseiten.de/reisebuero/bremen", "text": "\n\t\t\t\t\t\t\t\t", "tag": "a"}, {"url": "http://www.gelbes