{"h1": "Hausarzt-Wahl leicht gemacht", "description": null, "summary_text": "\nDer Hausarzt sollte Ihr erster Ansprechpartner bei allen medizinischen Fragen sein. Haus\ufffdrzte haben durch den regelm\ufffd\ufffdigen Kontakt mit Ihnen den besten \ufffdberblick \ufffdber Ihre Gesundheitssituation. Gleichzeitig vermittelt er seine Patienten an Spezialisten, f\ufffdr die er \ufffdberweisungen ausstellt. Durch den Arztbrief sind Haus\ufffdrzte dar\ufffdber hinaus auch die Sammelstelle f\ufffdr alle Diagnosen und Medikamenten-Verschreibungen. Der Hausarzt ist damit der Zugang zu Ihren medizinischen Daten bei Notf\ufffdllen, wenn Ambulanzen und Krankenh\ufffduserim In- und Ausland. Viele Haus\ufffdrzte bieten bei Bettl\ufffdgerigkeit Hausbesuche an. Dar\ufffdber hinaus bieten viele Haus\ufffdrzte Zusatzleistungen und Premiumdienste an - beispielsweise reisemedizinische Impfungen, Impfberatung, Allergietests und alternative Medizin. Die Hausarztwahl entscheidet damit auch \ufffdber Ihren Zugang zu solchen Angeboten. W\ufffdhlen Sie sich daher mit unserem Verzeichnis den Hausarzt aus, der zu Ihnen und Ihren Bed\ufffdrfnissen passt - mit N\ufffdhe, Erreichbarkeit, Serviceportfolio und den Zusatzdiensten, die Sie ben\ufffdtigen.\n\ufffd Matthias Preisinger / pixelio.de\nDer vom Hausarzt ausgestellte \ufffdberweisungsschein wird zur fach\ufffdrztlichen Behandlung ben\ufffdtigt.\n", "title": "Hausarzt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/hausarzt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "h