{"h1": "Mehr als ein M\u00fcllberg: der Schrottplatz", "description": null, "summary_text": "\nH\ufffdtten Sie's gewusst? Schrott ist nicht gleich Schrott. Den klassischen Schrottplatz stellt man sich \ufffdblicherweise als Endlagerst\ufffdtte verrostender, verbeulter Autos vor. Aber die Mitarbeiter von Schrottverarbeitungsfirmen leisten weit mehr, als ausgediente Wagen durch die Schrottpresse zu jagen. Sie sammeln, sortieren und reinigen Altmetalle, zerkleinern sie und bereiten sie fachgerecht wieder auf. So ist der Schrottplatz im Grunde ein Ort der wertvollen Rohstoffe, aus denen sich wieder Neues machen l\ufffdsst. Schrott kann beispielsweise Kupfer,Blech oder Aluminium, Zinn, Blei oder Messing enthalten und wird dann entsprechend recycelt. In kaputten Maschinen, Computern, Kabeln oder Autos stecken noch viele kostbare Rohstoffe. Man kann also durchaus darauf hoffen, auf dem Schrottplatz f\ufffdr seine alten Sch\ufffdtzchen noch Geld zu bekommen. Wenden Sie sich ruhig an einen professionellen Schrottank\ufffdufer, wenn Sie Ihre ausgedienten Haushaltsger\ufffdte, Telefone oder Rohre loswerden wollen - es lohnt sich bestimmt. Und Sie tun der Umwelt etwas Gutes.\n\ufffd W. Broemme / pixelio.de\nEin verrosteter US Firetruck auf einem Schrottplatz in Arizona\n", "title": "Schrottplatz im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/schrottplatz", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "te