{"h1": "Was ein Gyn\u00e4kologe leistet - die Aufgaben der Frauenheilkunde", "description": null, "summary_text": "\nDer Begriff Gyn\ufffdkologie kann mit dem deutschen Wort Frauenheilkunde wiedergegeben werden. Sie ist ein Teilbereich der Humanmedizin, der sich vorwiegend mit Erkrankungen der weiblichen Sexual- und Fortpflanzungsorgane besch\ufffdftigt. Dar\ufffdber hinaus geh\ufffdrt Pr\ufffdvention durch regelm\ufffd\ufffdige Vorsorgeuntersuchungen zum Leistungsspektrum einer gyn\ufffdkologischen Praxis. Jede Frau sollte sich einer j\ufffdhrlichen Krebsvorsorge unterziehen, damit eine potenzielle Erkrankung fr\ufffdhzeitig erkannt und behandelt werden kann. Der Gyn\ufffdkologe macht daf\ufffdr einen Abstrich und tastet die Brust ab. Da es sichum einen sensiblen Bereich handelt, ist ein Vertrauensverh\ufffdltnis zum behandelnden Arzt und seinem Team von entscheidender Bedeutung f\ufffdr das Wohlbefinden der Patientin. Gut ist es, wenn der Gyn\ufffdkologe der Patientin durch ein Gespr\ufffdch in der Praxis oder eine ansprechende Homepage einen ersten Eindruck vermitteln kann. Selbstverst\ufffdndlich umfasst das Gebiet der Gyn\ufffdkologie auch alles rund um die Schwangerschaft und Geburt. Der passende Gyn\ufffdkologe begleitet die schwangere Frau medizinisch durch diese aufregende Zeit.\n\ufffd JMG / pixelio.de\nDer Ultraschall beim Gyn\ufffdkologen dient der Abbildung der inneren Organe.\n", "title": "Gyn\u00e4kologe im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/gynaekologe", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "N