{"h1": "Der Urologe - Ein Facharzt f\u00fcr Urologie", "description": null, "summary_text": "\nAls Urologe d\ufffdrfen sich \ufffdrzte mit abgeschlossenem Medizin-Studium und einer entsprechenden Weiterbildung im Fachbereich der Urologie bezeichnen. Die Urologie ist somit ein wichtiger Teilbereich der Medizin, die sich mit den harnableitenden und harnbildenden Organen des Menschen besch\ufffdftigt, wozu vor allem Harnr\ufffdhre, Harnleiter, Nieren und Harnblase geh\ufffdren. Der Urologe besch\ufffdftigt sich somit mit der Vorbeugung und der Behandlung von Krankheiten, die diese Organe betreffen. Des Weiterenbehandelt er Krankheiten, die das Geschlechtsorgan des Mannes, im einzelnen zum Beispiel Hoden, Samenleiter oder Prostata betreffen. Ein Gang zum Urologen muss niemandem unangenehm sein, Pr\ufffdvention ist gerade auf dem Gebiet der Urologie sehr sinnvoll und kann das Entstehen von Krankheiten und anderen Problemen weitgehend verhindern. Vor allem kann ein Krebsbefall der betreffenden Organe, zum Beispiel der Prostata, fr\ufffdhzeitig erkannt und somit erfolgreich behandelt werden.\n\ufffd Matthias Preisinger / pixelio.de\nManchmal ist eine \ufffdberweisung zum Urologen unerl\ufffdsslich.\n", "title": "Urologe im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/urologe", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": 