{"h1": "HNO-Heilkunde: Schnelle Hilfe, Beratung und Versorgung", "description": null, "summary_text": "\nDie HNO-Heilkunde (Hals-Nasen-Ohren-Heilkunde) bietet schnelle Hilfe bei Erkrankungen, Funktionsst\ufffdrungen und Verwundungen im Bereich von Kopf und Hals; dazu z\ufffdhlen Luftwege und Speiser\ufffdhre, Kehlkopf, die Mundh\ufffdhle und Ohren. Besonders h\ufffdufig kommt es in diesen Regionen zu schmerzhaften Entz\ufffdndungen, die etwa mit Erk\ufffdltungen oder anderen Viruserkrankungen einhergehen; auch Tumorbildungen und Stimm- oder Sprachst\ufffdrungen k\ufffdnnen in diesem K\ufffdrperbereich auftreten. Die HNO-Heilkunde bietet hier schnelle und kompetente Hilfe.Darunter fallen, neben Diagnose und Behandlung, auch Vorbeugung und Nachsorge. Zuverl\ufffdssig wird sicher gestellt, dass Sie vom Erkennen der Erkrankung bis zur vollst\ufffdndigen Rehabilitation Begleitung finden k\ufffdnnen. Die von den jeweiligen \ufffdrzten und Praxen angewandten Methodiken variieren, wobei h\ufffdufig zur wissenschaftlichen Medizin die Naturheilkunde unterst\ufffdtzend hinzugezogen wird. Diese m\ufffdgliche Kombination soll garantieren, dass dem Patienten bestm\ufffdglich zugunsten einer raschen Genesung geholfen werden kann.\n\ufffd Rainer Sturm / pixelio.de\nEin kostenloser H\ufffdrtest wird in jeder HNO-Praxis angeboten.\n", "title": "HNO im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/hno", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbes