{"h1": "Der Proktologe - Spezialist f\u00fcr Darmkrebsvorsorge", "description": null, "summary_text": "\nJ\ufffdhrlich sterben tausende Menschen allein in Deutschland an Darmkrebs. Dabei geh\ufffdrt dieser zu den Krebsarten, f\ufffdr welche am besten Vorsorge getroffen werden kann und der, bei regelm\ufffd\ufffdiger Vorsorge und entsprechender Behandlung mit die besten Heilungschancen hat. Diese Vorsorgeuntersuchungen kann ein Proktologe fachm\ufffdnnisch durchf\ufffdhren, da sie in sein Spezialgebiet fallen. Vielen Menschen scheuen davor zur\ufffdck, da sie sich daf\ufffdr sch\ufffdmen, dass ein fremder Mensch sie an solch intimen Stellen anfasstund untersucht. Dem entsprechend bleibt ein Gro\ufffdteil der Darmkrebserkrankungen unerkannt, bis die ersten Symptome auftreten. Dies erschwert dann die Therapie und die Heilung. Sie sollten in jedem Fall Ihre eventuelle Scham \ufffdberwinden und die Vorsorge durch einen Proktologen durchf\ufffdhren lassen, die Kosten werden von Ihrer Krankenkasse \ufffdbernommen. Ein Proktologe kann Sie auch im Falle anderer chronischer oder akuter Darm- oder Aftererkrankungen wie zum Beispiel Stuhlinkontinenz, H\ufffdmorrhoiden sowie Analfisteln oder -abszesse behandeln.\n\ufffd Gerd Altmann / pixelio.de\nProktologe: Der Mensch steht im Mittelpunkt einer Behandlung\n", "title": "Proktologe im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/proktologe", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.