{"h1": "Der Pulmologe: Der Facharzt f\u00fcr die Lunge", "description": null, "summary_text": "\nDas Wort Pulmologe ist wenig bekannt. Es handelt sich hierbei um einen Facharzt f\ufffdr Lungenkrankheiten. Auch die Pr\ufffdvention geh\ufffdrt zu seinem Aufgabengebiet. Er hat den Patienten darin zu unterst\ufffdtzen, Erkrankungen der Lunge und der Bronchien zu vermeiden und diese gegebenenfalls zu behandeln. Das bedeutet, dass der Pulmologe versuchen muss, Lungenkrankheiten zu verhindern und sie gegebenenfalls zu heilen, zumindest aber deren Verschlimmerung zu verhindern. Dar\ufffdberhinaus behandelt er aber neben Erkrankungen der Lunge auch Erkrankungen der Atemwege. Wichtige Lungenkrankheiten sind heute vor allem gewisse Volkskrankheiten, wie akute und chronische Bronchitis sowie Asthma. Ein Pulmologe hat daneben aber auch noch verschiedene andere Krankheiten zu behandeln, zum Beispiel Lungenentz\ufffdndung, Lungenkrebs, Sarkoidose, Lungen\ufffddeme und Lungenfibrose. Bei all diesen Krankheiten ist es immer am besten, sofort einen Facharzt f\ufffdr Lungenkrankheiten aufzusuchen.\n\ufffd Rainer Sturm / pixelio.de\nEin Pulmologe testet unter anderem die Lungenfunktion\n", "title": "Pulmologe im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/pulmologe", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag