{"h1": "Der Kinderarzt - ein enger Vertrauter der Eltern", "description": null, "summary_text": "\nEin Besuch beim Kinderarzt ist f\ufffdr viele Eltern und Kinder nicht immer eine Freude. Aber sie sind nat\ufffdrlich notwendig, damit Ihr Kind rundum gut versorgt ist. Insbesondere die U-Untersuchungen sind \ufffdu\ufffderst wichtig. Hierbei \ufffdberpr\ufffdft der Kinderarzt die Entwicklung Ihres Kindes, seine Beweglichkeit, seine Augen und Vitalfunktionen. Aber ebenso wichtig sind die regelm\ufffd\ufffdigen Impfungen. Eine Impfung sch\ufffdtzt Ihr Kind vor gef\ufffdhrlichen Krankheiten wie Masern, Mumps und R\ufffdteln.Der Kinderarzt \ufffdberwacht den Stand der Impfungen und informiert Sie nat\ufffdrlich \ufffdber m\ufffdgliche Risiken und Nebenwirkungen. Aber auch im Krankheitsfall ist er immer f\ufffdr Sie und Ihr Kind da und versorgt sie nach bestem Wissen. Er steht Ihnen bei allen Entwicklungsschritten Ihres Kindes zur Seite. Auch in Problemf\ufffdllen, z.B. bei Entwicklungsst\ufffdrungen ist er Ihr perfekter Ansprechpartner, der Sie im Bedarfsfall an einen Spezialisten weiter leitet.\n\ufffd erysipel / pixelio.de\nAufgabe Kinderarzt: Kardiologische Untersuchung eines S\ufffduglings\n", "title": "Kinderarzt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/kinderarzt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text"