{"h1": "Notarzt: Soforthilfe f\u00fcr Jedermann!", "description": null, "summary_text": "\nNotarzt: Soforthilfe f\ufffdr Jedermann!\nSie haben ein akutes Problem und brauchen sofort Hilfe? Dann rufen Sie einen Notarzt!\n\nEin Notarzt ist vor allem auf akute und lebensgef\ufffdhrdende Verletzungen spezialisiert. Um als Notarzt praktizieren zu k\ufffdnnen, muss er zus\ufffdtzlich zur \ufffdrztlichen Ausbildung besondere Qualifikationen in Notfallmedizin aufweisen k\ufffdnnen. Wenn Sie also Hilfe ben\ufffdtigen z\ufffdgern Sie nicht sich bei einer Rettungsleitstelle zu melden. Diese wird dann zus\ufffdtzlich zum Rettungswagen, bei Bedarf, auch einen Notarzt entsenden. Er ist so ausgestattet, dass er die Erstversorgung des Patienten durchf\ufffdhren kann unddiesen auch zum Transport vorbereiten kann. Ihm steht eine Reihe an Medikamenten und medizinischen Ger\ufffdten zur Verf\ufffdgung so, dass er immer ideal auf einen Notfall reagieren kann. Seine Aufgaben sind unter anderem: die Durchf\ufffdhrung akut lebensrettender medizinischer Ma\ufffdnahmen, die Linderung von Schmerzen und im \ufffdu\ufffdersten Fall die Feststellung des Todes. In einigen St\ufffddten gibt es auch speziell ausgebildete Kindernot\ufffdrzte, die sich um die Erstversorgung von Kindern k\ufffdmmern.\n\ufffd Erich Kasten / pixelio.de\nEin PKW hat sich \ufffdberschlagen, der Notarzt ist schon da.\n\n\n\nAusgew\u00e4hltes Bundesland: \n\n\n", "title": "Notarzt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/notarzt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "N