{"h1": "Eine Spedition ist ein Transportdienstleister.", "description": null, "summary_text": "\nEine Spedition versendet Waren auf verschiedenen Transportwegen und bietet die Dienstleistung ihren Kunden an. Der Warenversand umfasst die Organisation des Transports und auch weitere Dienstleistungen, die sich darauf beziehen. Zu den angebotenen Diensten eines solchen Dienstleister z\ufffdhlt nicht nur der Verkauf einzelner Bef\ufffdrderungsleistungen, sondern auch die Organisation von Dienstleistungspaketen, die aus Transport, Umschlag, Lagerung und Logistik bestehen. Der Transport der Wareng\ufffdter erfolgt\ufffdber Eisenbahn, LKW, auf See oder mit dem Binnenschiff. Erste Unternehmen gab es bereits im 19. Jahrhundert. Heutzutage haben sich die Dienstleister auf zahlreichen Gebieten spezialisiert, beispielsweise internationaler Versand, Luftfracht oder auch Lebensmittelversand und Zollspedition. Trotz dieser Spezialisierung werden die meisten Dienstleistungen auf Grundlage der Allgemeinen Deutschen Spediteursbedingungen abgewickelt. Nur bei Vertr\ufffdgen mit Privatpersonen, wie bei M\ufffdbelspeditionen, k\ufffdnnen andere Vertragsbedingungen gelten.\n\ufffd RainerSturm / pixelio.de\nIn einer Spedition geh\ufffdren Container- und \ufffdberseetransporte zum Tagesgesch\ufffdft.\n", "title": "Spedition im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/spedition", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security