{"h1": "Notare bei Gelbe Seiten", "description": null, "summary_text": "\nNotare bei Gelbe Seiten\nWahl des Bundeslandes f\ufffdr passende Firmenadressen zu Notare\n\n    \t\tSie sind auf der Suche nach einer Adresse oder Telefonnummer zu Notare. W\ufffdhlen Sie bitte nun das gew\ufffdnschte Bundesland, in dem Sie Rechtanw\ufffdlte, Kanzleien und Rechtspezialisten finden m\ufffdchten. Wenn Sie unten auf die hervorgehobene \ufffdberschrift \"Notare im entsprechenden Bundesland\" oder auf \"mehr\" klicken, gelangen Sie zur \ufffdbersicht aller St\ufffddte innerhalb des gew\ufffdnschten Bundeslandes. Gleicherma\ufffden k\ufffdnnen Sie die Karte links verwenden, um das Bundesland zu w\ufffdhlen. Von Arbeitsrecht \ufffdber Familienrecht oder Strafrecht, bis hin zu Kontaktdaten zur Rechtsanwaltskammer in Ihrer Stadt erhalten Sie die Ergebnisse zu Ihrer Suchanfrage Notare.\n\n\n\nAusgew\u00e4hltes Bundesland: \n\n\n", "title": "Notare im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/notare", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroo