{"h1": "Tierschutz ist oberstes Gebot im Tierheim", "description": null, "summary_text": "\nTierheime k\ufffdmmern sich haupts\ufffdchlich um herrenlose Haustiere. In manchen werden auch Wildtiere betreut oder Tiere in Pension genommen, zum Beispiel wenn der Besitzer in den Urlaub f\ufffdhrt oder l\ufffdnger krank ist. Ein Tierheim wird meist von einem Tierschutzverein betrieben und ist eine sinnvolle Anlaufstation, wenn Sie ein neues Haustier haben m\ufffdchten, ein Tier abgeben wollen oder m\ufffdssen, ein entlaufenes Tier suchen oder Tieren ehrenamtlich helfen wollen. Wer ein neues Haustier haben m\ufffdchte, sollte sich auch in einem Tierheim umsehen,denn den passenden neuen \"Mitbewohner\" findet man nicht nur bei Z\ufffdchtern. Ein Teil der Tiere, die dort aufgenommen werden, sind Fundtiere. Manche sind weggelaufen und k\ufffdnnen dort von ihren Besitzern dort abgeholt werden. Manche sind ausgesetzt worden - was aber nicht sein muss. Wenn Sie sich nicht mehr um Ihr Tier k\ufffdmmern k\ufffdnnen, was unter den verschiedensten Umst\ufffdnden der Fall sein kann, k\ufffdnnen Sie es im Tierheim abgeben. Dort wird das Tier versorgt und bekommt vielleicht ein neues Zuhause.\n\ufffd Karl-Heinz Laube / pixelio.de\nEin Tierheim k\ufffdmmert sich um die Unterbringung von herrenlosen Tieren\n", "title": "Tierheim im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/tierheim", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_s