{"h1": "Kardiologe - Facharzt f\u00fcr Herz und Kreislauf", "description": null, "summary_text": "\nDie Kardiologie ist der wissenschaftliche Zweig innerhalb der Inneren Medizin, der sich mit dem weiten Feld der Herz-Kreislauferkrankungen besch\ufffdftigt. Neben angeborenen Herzleiden oder genetisch bedingter Venenschw\ufffdche werden im Laufe des Lebens erworbene Erkrankungen, die nicht zuletzt auf den Lebenswandel unserer westlichen Gesellschaft zur\ufffdckzuf\ufffdhren sind, immer h\ufffdufiger. Laut dem Statistischen Bundesamt ist und bleibt die h\ufffdufigste Todesursache der Deutschen im Jahr 2010 mit rund 41 % eine Erkrankung des Herz-/Kreislaufsystems und deren Folgen. Der Kardiologe hat bei fr\ufffdhzeitiger Erkennung der Erkrankungdie M\ufffdglichkeit, durch gezielte Beratung, Medikation und/oder Operation erfolgreich in das Krankheitsgeschehen einzugreifen. Zu den bekanntesten Methoden der Diagnostik des Kardiologen z\ufffdhlen die Blutdruckmessung und das Elektrokardiogramm (EKG). Gegebenenfalls leitet der Kardiologe im Anschluss daran aufwendigere Untersuchungen ein. Das kann beispielsweise die Erstellung eines R\ufffdntgenbildes des Herzens, eine Ultraschalluntersuchung (Echokardiografie) oder die Untersuchung der Herzkranzgef\ufffd\ufffde mittels eines Herzkatheters sein. In Deutschland sind mehr als 7000 Herzspezialisten berufst\ufffdtig. Ein passender Kardiologe f\ufffdr Ihre individuellen Beschwerden findet sich bestimmt auch in Ihrer N\ufffdhe!\n\ufffd Herzschlag 002/ pixelio.de\nDer Kardiologe behandelt Herz- und Gef\ufffd\ufffderkrankungen im Krankenhaus.\n", "title": "Kardiologe im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/kardiologe", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n