{"h1": "Die Hygiene l\u00e4sst zu w\u00fcnschen \u00fcbrig - erst Recht im Krankenhaus", "description": null, "summary_text": "\nJ\ufffdngst ger\ufffdt wieder ein Krankenhaus in die deutschen Medien - es wird hei\ufffd diskutiert. Wer tr\ufffdgt die Schuld? Warum sterben Babys durch hygienische M\ufffdngel? Was ist der Hintergrund und wieso kann man das nicht verhindern? Diese Fragen und viele weitere stellt sich zurzeit die Gesellschaft f\ufffdr Krankenhaushygiene. Nach den neusten Ereignissen stehen wieder einmal die Krankenh\ufffduser im Visier s\ufffdmtlicher Beh\ufffdrden. Bekannt ist, dass die Hygiene zu w\ufffdnschen \ufffdbrig l\ufffdsst, dortwo diese eigentlich sehr wichtig ist. Erreger, Bakterien und Viren k\ufffdnnen so noch leichter an Patienten gelangen und bis zum Tod f\ufffdhren. Wenn man heute in ein Krankenhaus eintritt, f\ufffdllt auf, dass an mindestens jeder zweiten Ecke ein Desinfiktionskasten h\ufffdngt, wieso also passieren immer noch so h\ufffdufig schwere Unf\ufffdlle, die auf hygienische M\ufffdngel schlie\ufffden l\ufffdsst. Die Krankenh\ufffduser sind sprachlos. Soll jetzt das Gestatten von Besuchen verboten werden? Diskutieren Sie mit uns.\n\ufffd Rainer Sturm / pixelio.de\nEin abgedecktes Bett steht auf dem Flur im Krankenhaus.\n", "title": "Krankenhaus im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/krankenhaus", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text