{"h1": "Der Tierarzt betreut das Tier, wie der Humanmediziner den Menschen", "description": null, "summary_text": "\nSo wie wir Menschen, brauchen auch unsere Haus- und Nutztiere eine regelm\ufffd\ufffdige \ufffdrztliche Betreuung. In einer Kleintierpraxen k\ufffdmmert sich der Tierarzt um die Belange der \"klassischen\" Haustiere wie Hunde, Katzen und Nager. Bei einem Tierarzt werden Prophylaxema\ufffdnahmen wie Impfungen oder Zahnpflege angeboten und kleinere operative Eingriffe wie Kastrationen und Sterilisationen durchgef\ufffdhrt. Aber nat\ufffdrlich geh\ufffdren auch Diagnose und Behandlung diverser Erkrankungen zum Berufsalltag. Ein Tierarzt kann sich, wie ein Humanmediziner, auf exotischere Fachdisziplinen spezialisieren, um sich dann um Reptilien und Schlangen oder Zootiere k\ufffdmmern zu k\ufffdnnen.In Gro\ufffdtierpraxen geht es in erster Linie um die medizinische Versorgung von Nutztieren. Gerade am Land sind spezielle Kenntnisse der Tiergesundheit von K\ufffdhen, Schafen oder auch Pferden gefragt. Dabei geht es zum Beispiel um die Bek\ufffdmpfung von Tierseuchen und die Einhaltung der Richtlinien in der Lebensmittelproduktion. Ein amtlicher Tierarzt ist ebenfalls zust\ufffdndig f\ufffdr die so genannte \"Fleischbeschau\", bei der nach der Schlachtung die Genie\ufffdbarkeit des Fleisches f\ufffdr den Menschen sichergestellt werden muss. Veterin\ufffdrmediziner sind in diesem Sinne auch f\ufffdr die Gesundheit des Menschen zust\ufffdndig!\n\ufffd Ruth Rudolph / pixelio.de\nDer Tierarzt k\ufffdmmert sich um den kranken Vierbeiner.\n", "title": "Tierarzt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/tierarzt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url":