{"h1": "Das Versorgungsamt - soziale Sicherung und Entsch\u00e4digung", "description": null, "summary_text": "\nDas Versorgungsamt - soziale Sicherung und Entsch\ufffddigung\nAls Sozialleistungstr\ufffdger \ufffdbernimmt das Versorgungsamt vielf\ufffdltige Aufgaben\n\nDie Versorgungs\ufffdmter sind in Deutschland in den einzelnen Bundesl\ufffdndern zust\ufffdndig f\ufffdr die Versorgung von Kriegsopfern, Soldaten und Zivildienstleistenden, sowie f\ufffdr Opferentsch\ufffddigungen und seit 2001 auch f\ufffdr Schwerbehindertenangelegenheiten. Das heutige Versorgungsamt entstand aus der urspr\ufffdnglich reinen Entsch\ufffddigung von Kriegsopfern, die in Deutschland bereits im Jahr 1871 eingef\ufffdhrt wurde und in unterschiedlichen Gesetzen geregelt wurde, so zum Beispiel dem Reichsversorgungsgesetz von 1920 nach dem Ersten Weltkriegund dem noch heute g\ufffdltigen Bundesversorgungsgesetz, das im Jahr 1950 in Kraft trat. In den einzelnen Bundesl\ufffdndern ist das Versorgungsamt aufgrund der Verwaltungskompetenzen der L\ufffdnder unterschiedlich strukturiert und gestaltet. Auch \ufffdbernehmen die Versorgungs\ufffdmter in einigen Bundesl\ufffdndern zus\ufffdtzliche Aufgaben, wie zum Beispiel die Auszahlung des Elterngeldes oder die Schaffung verschiedener Beratungsangebote. \ufffdblicherweise findet man f\ufffdr das Versorgungsamt heute die zeitgem\ufffd\ufffdere Bezeichnung \"Amt f\ufffdr soziale Angelegenheiten.\"\n\ufffd Albrecht E. Arnold / pixelio.de\nDas Versorgungsamt k\ufffdmmert sich um die Belange von Schwerbehinderten.\n\n\n\nAusgew\u00e4hltes Bundesland: \n\n\nVersorgungsamt in Deutschland:\n\n\n", "title": "Versorgungsamt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/versorgungsamt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseite