{"h1": "Der Maler gestaltet Ihr Heim", "description": null, "summary_text": "\nDie T\ufffdtigkeit des Malers beschr\ufffdnkt sich nicht allein auf das farbige Anstreichen von W\ufffdnden. Vielmehr k\ufffdmmert sich der Maler auch um die entsprechende Vorbehandlung der Fl\ufffdchen und er bringt unterschiedliche Bel\ufffdge auf, wie beispielsweise Tapeten oder Folien. Zu den elementarsten Arbeitstechniken des Malers geh\ufffdren das Grundieren, das Spachteln zum Ausgleichen von Unebenheiten und ebenso das Spritzen oder Streichen. Der Maler muss mit unterschiedlichen Werkzeugen umgehen k\ufffdnnenwie etwa mit Pinseln, Walzen, Spachteln und Spritzger\ufffdten. Dar\ufffdber hinaus muss der Maler auch \ufffdber gewisse chemische Kenntnisse verf\ufffdgen im Umgang mit Farben, Lacken, L\ufffdsungsmitteln und \ufffdhnlichen Substanzen. Denkmalpflege ist ebenso eine Aufgabe im vielf\ufffdltigen Berufsbild des Malers wie Bau- und Korrosionsschutz. Au\ufffderdem ben\ufffdtigt er Einf\ufffdhlungsverm\ufffdgen, um die Vorstellungen des Kunden umsetzen zu k\ufffdnnen und er muss ein gutes Gef\ufffdhl f\ufffdr Formen und Farben besitzen.\n\ufffd RainerSturm / pixelio.de\nEin Maler sorgt daf\ufffdr, dass die W\ufffdnde fachgerecht gestrichen sind.\n", "title": "Maler im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/maler", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "