{"h1": "Das Gesundheitsamt sorgt f\u00fcr Sauberkeit und Hygiene", "description": null, "summary_text": "\nDas Gesundheitsamt ist eine staatliche, medizinische Verwaltungsbeh\ufffdrde und medizinische Institution. Seine Aufgabe ist die \ufffdberwachung und Verbesserung der Gesundheit der B\ufffdrgerinnen und B\ufffdrger in Deutschland. Mit seinen zahlreichen T\ufffdtigkeiten und Aufgaben besch\ufffdftigt das Gesundheitsamt eine Vielzahl an Medizinern, Forschern, Sachbearbeitern, Kundenbehandlern und Labortechnikern. Ein wichtiger Aufgabenbereich ist die Seuchenkontrolle. Gesundheits\ufffdmter sammeln Informationen \ufffdber die Verbreitung ansteckender Krankheiten. Gleichzeitig haben sie Verantwortung \ufffdber Impfstoffe und Impfstrategien im Lokalbereich. Damit wirddie Verbreitung gef\ufffdhrlicher Infektionswellen niedrig gehalten. Ein weiterer wichtiger Punkt ist die Hygienekontrolle. Hier geht es vor allem um die Kontrolle von Krankheitsausbreitung und die Vermeidung von Lebensmittelvergiftungen. Kontrollen umfassen Personal im Lebensmittel- und Gastronomiebereich sowie die Qualit\ufffdt von Lebensmitteln in der Herstellung, Lagerung und Verwendung. Zus\ufffdtzlich ber\ufffdt und betreut das Gesundheitsamt Personen in Risikoberufen, und stellt die f\ufffdr manche Berufe oder Reisen in bestimmte L\ufffdnder notwendigen Gesundheitszeugnisse aus.\n\ufffd Matthias Preisinger\nDie Aufgaben im Gesundheitsamt k\ufffdnnen vielf\ufffdltig sein.\n", "title": "Gesundheitsamt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/gesundheitsamt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url"