{"h1": "Der Kinderpsychologe ist ein Ansprechpartner im Bedarfsfall", "description": null, "summary_text": "\nViele Menschen verbinden mit dem Wort Kinderpsychologe etwas Negatives. Der Kinderarzt schickt Kinder oftmals zum Kinderpsychologen, wenn es in der Entwicklung zu Schwierigkeiten kommt. Insbesondere wird er bei ADS oder ADHS zu Rate gezogen. Viele Eltern sind mit so einer Situation \ufffdberfordert und er kann Ihnen alle Ihre Fragen beantworten und Ihnen hilfreich zur Seite stehen. Doch ein Kinderpsychologe k\ufffdmmert sich auch umIhr Kind, wenn z.B. gepr\ufffdft werden soll, ob Ihr Kind schon fr\ufffdher eingeschult werden kann. Er f\ufffdhrt dann einen Intelligenztest bei Ihrem Kind durch, um die geistige Entwicklung zu testen. Entsprechend des Alters Ihres Kindes werden Spiele gespielt, Bilder gemalt oder \ufffdhnliches. In einem Abschlussgespr\ufffdch wird der Spezialist mit Ihnen besprechen, welche M\ufffdglichkeiten es f\ufffdr Ihr Kind gibt und welche er Ihnen empfiehlt.\n\ufffd komm, ich zieh dich, kleiner bruder!/ pixelio.de\nDer Kinderpsychologe hilft nach Traumata zur\ufffdck in die unbeschwerte Kindheit.\n", "title": "Kinderpsychologe im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/kinderpsychologe", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://ser