{"h1": "Das Schauspielhaus: Unterhaltung und Kultur", "description": null, "summary_text": "\nDas Schauspielhaus ist ein Theater, also ein \ufffdffentlicher Raum der der Auff\ufffdhrung von Schauspielen dient. Ein Schauspiel z\ufffdhlt zum Sprechtheater - im Gegensatz zur Oper. Der Begriff wird haupts\ufffdchlich dann verwendet, wenn das Schauspielhaus ausschlie\ufffdlich Schauspiel anbietet, aber nicht Musik- oder Tanztheater. Meistens lassen sich in einem Schauspielhaus verschiedene Theaterr\ufffdume finden, die f\ufffdr verschiedene Schauspiele genutzt werden. Das Schauspielhaus spielt im \ufffdffentlichen kulturellen Leben eine wichtige Rolle, denn neben den klassischen Theaterst\ufffdcken werden auch moderne St\ufffdcke von jungen Autoren aufgef\ufffdhrt, die zum Teil auchsozialkritische oder gesellschaftspolitische Themen der Zeit in den Fokus r\ufffdcken. Im Gegensatz zur Oper, die mehr unterhaltenden Wert besitzt, ist das Theater also auch eine Institution, durch die aktuelles, kulturelles Leben und Entwicklung erfahrbar und zeigbar gemacht wird. Im Theater wird eine parallele Wirklichkeit konstruiert, die anderen Gesetzm\ufffd\ufffdigkeiten gehorcht. Als Zuschauer sieht man sich selbst und die Wirklichkeit in den St\ufffdcken gespiegelt. Die Dramatik oder Komik eines St\ufffdckes zeigt die Dramatik oder Komik des Lebens, ohne zu sehr auf es bezogen zu sein.\n\ufffd Dieter Sch\ufffdtz / pixelio.de\nDas Landestheater oder auch Schauspielhaus in Detmold ist die gr\ufffd\ufffdte Reiseb\ufffdhne Europas\n", "title": "Schauspielhaus im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/schauspielhaus", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbes