{"h1": "Der Elektriker- Freund und Helfer.", "description": null, "summary_text": "\nDer Elektriker erbringt alle Dienstleistungen wenn es darum geht, Ihnen in Angelegenheiten die mit Strom zu tun haben, unter die Arme zu greifen. Aus diesem Grund ist er meist \ufffdberall dort anzutreffen, wo mit Strom gearbeitet wird: Ob auf der Baustelle, in Werkst\ufffdtten oder im direkten Kundendienst. So ist der Elektriker zust\ufffdndig f\ufffdr die Montage zum Beispiel Ihres Schaltkastens, f\ufffdr die Versorgung mit Strom, aberauch f\ufffdr die Wartung schon vorhandener Ger\ufffdte. Im Laufe der Technisierung und der Modernisierung haben sich noch weitere T\ufffdtigkeitsfelder f\ufffdr diesen Beruf herausgebildet, die sich auch mit modernen Themen besch\ufffdftigen. Zus\ufffdtzlich \ufffdbt Ihr Elektriker eine beratende Funktion aus - ob es sich um die Wahl einer geeigneten Lampe handelt oder um die Anbringung einer Steckdose, er kann Ihnen stets einen optimalen Ratschlag geben.\n\ufffd Rainer Sturm / pixelio.de\nElektrische Anschl\ufffdsse sollten von einem Elektriker installiert werden\n", "title": "Elektriker im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/elektriker", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\