{"h1": "Die Polizei - Unser Freund und Helfer", "description": null, "summary_text": "\nGanz formal ausgedr\ufffdckt bezeichnet die Polizei das Exekutivorgan eines Staates, wobei die Befugnisse in einem eigenen Polizeirecht festgelegt sind. Der Hauptschwerpunkt der Arbeit eines Polizisten liegt auf der Bewahrung und Wiederherstellung der Sicherheit und Ordnung innerhalb eines Staates. Dazu kommen noch die Regelung des Stra\ufffdenverkehres und die Erforschung von Handlungen, die gegen das Gesetz sind. Bei der Anwendung von Gewalt ist esder Polizei nat\ufffdrlich erlaubt, sofort einzuschreiten. Die einzelnen Aufgabengebiete und Strukturen weisen von Land zu Land teilweise sehr gro\ufffde Unterschiede auf und so kann die Polizei in einigen L\ufffdndern beispielsweise geradezu milit\ufffdrisch organisiert sein. Es gibt auch die sogenannte Internationalen Kriminalpolizeiliche Organisation (IKPO-Interpol), die zur Verbesserung der internationalen Kooperation und Koordination dient und so vor allem gegen die grenz\ufffdberschreitende Kriminalit\ufffdt vorgeht.\n\ufffd Arno Bachert / pixelio.de\nDie Polizei ist dein Freund und Helfer.\n", "title": "Polizei im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/polizei", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseite