{"h1": "Der Notar - ein hoch qualifizierter Beruf f\u00fcr verantwortungsvolle Aufgaben", "description": null, "summary_text": "\nZu den Hauptaufgaben eines Notars z\ufffdhlen die Beglaubigung von Unterschriften sowie die Beurkundung von Rechtsgesch\ufffdften. Da dem Notar eine gro\ufffde Vertrauensstellung zukommt, sind die Zulassungsvorschriften in Deutschland streng geregelt. Nur ein Volljurist darf sich um das Amt des Notars bewerben. Volljurist bedeutet, dass der Anw\ufffdrter das zweite Staatsexamen erfolgreich absolviert und somit die Bef\ufffdhigung erlangt hat, ein Richteramt zu bekleiden. Bewerben deshalb, weiles nur eine streng begrenzte, den Bed\ufffdrfnissen der Bev\ufffdlkerung angepasste Anzahl von Notaren gibt. Die Kandidaten melden sich jeweils auf eine Stellenausschreibung und werden dann gew\ufffdhlt. Haupts\ufffdchlich widmet sich der Notar dem Familien- und Erbrecht sowie dem Gesellschafts- und Grundst\ufffdcksrecht. Manche Urkunden und Vertr\ufffdge sind nur mit einem notariellen Siegel g\ufffdltig. Der Notar ist bei der Erstellung der Dokumente behilflich und ber\ufffdt umfassend.\n\ufffd Rainer Sturm / pixelio.de\nEin Notar mit Stempel, auf dem \"Testament\" steht\n", "title": "Notar im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/notar", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Sta