{"h1": "Z\u00f6gern Sie bei einem Unfall nicht und rufen Sie den Unfallarzt!", "description": null, "summary_text": "\nSie haben schon einmal einen schlimmen Unfall erlebt und waren mit der Situation total \ufffdberfordert? So ergeht es vielen Menschen, die sich zum ersten Mal mit so etwas konfrontiert sehen. Ein Unfall sorgt bei den meisten f\ufffdr einen schock\ufffdhnlichen Zustand, sodass man nicht mehr wei\ufffd, wie man sich verhalten sollte. Wenn Sie dem Unfallopfer m\ufffdglichst schnell helfen wollen, dann rufen Siedirekt einen Unfallarzt. Schildern Sie den Unfall, berichten Sie \ufffdber den Zustand des Opfers und warten Sie bis zum Eintreffen des Rettungswagens. Ein Unfallarzt ist auf jegliche Unf\ufffdlle spezialisiert und h\ufffdlt f\ufffdr jede Verletzung die passende Behandlungsma\ufffdnahme schnell bereit. So kann der Unfallarzt mit seiner Erfahrung, die normale \ufffdrzte nicht haben, schnell und unkompliziert den Zustand des Opfers stabilisieren und verbessern.\n\ufffd Erich Kasten / pixelio.de\nDer Unfallarzt stellt die Art und Schwere der Verletzung fest.\n", "title": "Unfallarzt im Gelbe Seiten Branchenbuch - Unternehmen in Deutschland finden", "link_url": "http://www.gelbeseiten.de/branchenbuch/unfallarzt", "args": {"arg0": "2013-09-06"}, "links": [{"url": "http://www.gelbeseiten.de", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInserenten", "tag": "a"}, {"url": "http://service.gelbeseiten.de/", "text": "Download\n\t\t\t& Service", "tag": "a"}, {"url": "http://service.gelbeseiten.de/newsroom", "text": "Newsroom", "tag": "a"}, {"url": "https://sso.gelbeseiten.de/sso/logout?service=https://meine.gelbeseiten.de/j_spring_security_logout", "text": "Ausloggen", "tag": "a"}, {"url": "http://www.gelbeseiten.de/", "text": "Zur Startseite", "tag": "a"}, {"url": "http://service.gelbeseiten.de/inserenten", "text": "F\u00fcr\n\t\t\tInser